import React from "react";
import { useSelector } from "react-redux";

function Home() {
  const { user } = useSelector((state) => state.auth);
  return (
    <div>
      <h1>Ürünlerin geleceği ana sayfa burası olacaktır</h1>
    </div>
  );
}

export default Home;
